import React from 'react';
import styled from 'styled-components';

import Mamber1 from '../img/man1.jpg';
import Mamber3 from '../img/man2.webp';
import Mamber2 from '../img/woman.webp';
import Mamber4 from '../img/woman2.jpg';
import './HeaderBackground.css';

const Illustration = styled.div`
    position:absolute;
    height: 636px;
    width: 1900px;

`
const Photo1 = styled.div`
    border-width: 378px 0 0 285px;
    border-color: transparent transparent transparent #fd4d3f;
    left: -28px;
    bottom: -28px;
    position: absolute;
    border-style: solid;
    z-index: -5;

    img{
        width: 300px;
        height: 372px;
        position: relative;
        left: 300px;
    }

`
const Photo2 = styled.div`


    img{
        width: 400px;
        height: 320px;
        position: absolute;
        right: 1000px;
        left: 434px;
        top: 159px;
    }

`
const Photo3 = styled.div`


    img{
        width: 465px;
        height: 299px;
        position: absolute;
        right: 560px;
        top: 238px;    
    }
`
const Photo4 = styled.div`


    img{
        width: 300px;
        height:300px;
        position: absolute;
        right: 450px;
        top: 50px;
    }
`

class HeaderBackground extends React.Component{
    render(){
        return(
            <Illustration className='illistration'>
                <Photo1><img className='img1' src={Mamber1} alt='man'/></Photo1>
                <Photo2><img src={Mamber2} alt='man'/></Photo2>
                <Photo3><img src={Mamber3} alt='man'/></Photo3>
                <Photo4><img src={Mamber4} alt='man'/></Photo4>

            </Illustration>

        );
    }
}

export default HeaderBackground;
